import React,{useState} from 'react';
import Button from 'react-bootstrap/Button'

const Login = (props) => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleChange = (event, type) => {
        console.log(event.target.value);
    }
    return (
        <form className="form">
            <div className="form-group row">
                <div className="col-md-6">
                    <lable className="col-md-2">Username</lable>
                    <input type="text" name="username" onChange={(event) => handleChange(event, 'username')} />
                </div>
                <div>
                    <lable className="col-md-2">Password</lable>
                    <input type="password" name="password" onChange={(event) => handleChange(event, 'password')}/>
                </div>
                <div>
                    <input type="radio" name="userType" />Admin
                    <input type="radio" name="userType" />User
                </div>
                <div>
                    <Button variant="primary">Login</Button>
                </div>
            </div>
        </form>
    )
}

export default Login;
